import React from 'react';
import styled from 'styled-components';

const FullPageContainer = styled.div`
  min-height: 100vh;
  width: 100%;
  background-color: #1a1a1a;
  color: white;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
  box-sizing: border-box;
`;

const Header = styled.header`
  text-align: center;
  margin-bottom: 40px;
`;

const Title = styled.h1`
  font-size: 2.5em;
  margin-bottom: 10px;
`;

const Subtitle = styled.p`
  font-size: 1.2em;
`;

const CirclesContainer = styled.div`
  position: relative;
  width: 100%;
  max-width: 1000px;
  height: 500px;
`;

const Circle = styled.div`
  position: absolute;
  width: 300px;
  height: 300px;
  border-radius: 50%;
  background-color: ${props => props.color};
  display: flex;
  align-items: center;
  justify-content: center;
  overflow: hidden;

  ${props => props.position === 'left' && `
    left: 0;
    top: 50px;
  `}

  ${props => props.position === 'center' && `
    left: 50%;
    top: 0;
    transform: translateX(-50%);
  `}

  ${props => props.position === 'right' && `
    right: 0;
    top: 100px;
  `}
`;

const CircleContent = styled.img`
  width: 100%;
  height: auto;
`;

const App = () => {
  return (
    <FullPageContainer>
      <Header>
        <Title>Have a look Around!</Title>
        <Subtitle>And you will find everything you need to build a great looking website</Subtitle>
      </Header>
      <CirclesContainer>
        <Circle color="#ff6b6b" position="left">
          <CircleContent src="path_to_left_image.jpg" alt="Left content" />
        </Circle>
        <Circle color="#fdee42" position="center">
          <CircleContent src="path_to_center_image.jpg" alt="Center content" />
        </Circle>
        <Circle color="#ffcf5e" position="right">
          <CircleContent src="path_to_right_image.jpg" alt="Right content" />
        </Circle>
      </CirclesContainer>
    </FullPageContainer>
  );
};

export default App;
